/*****************************************************************************
*  Tipo de objeto:      Table
*  Funcion: Crea una tabla para guardar los empleados más relaciones
*  Autor :  Alfredo Xochitemol	Cruz
*  Fecha de Creación: 2021/09/27
*  Log de Mantenimiento: 
*  Date         Modified By       Description            
*  ----------   ---------------   -------------------------------------
******************************************************************************/


CREATE TABLE [dbo].[empleados](
	--nuevos campos
	[id] [int] IDENTITY(1,1) NOT NULL,
	[nueva_fecha_nacimiento] [date] NULL,
	[planta_clave] [int] NULL,
	--campos anteriores
	[clave] [int] NULL,
	[activo] [bit] NULL,
	[numeroEmpleado] [nvarchar](255) NULL,
	[nombre] [nvarchar](255) NULL,
	[apellido1] [nvarchar](255) NULL,
	[apellido2] [nvarchar](255) NULL,
	[nacimientoFecha] [nvarchar](255) NULL,
	[correo] [nvarchar](255) NULL,
	[telefono] [nvarchar](255) NULL,
	[extension] [nvarchar](255) NULL,
	[celular] [nvarchar](255) NULL,
	[nivel] [nvarchar](255) NULL,
	[puesto] [int] NULL,
	[compania] [nvarchar](255) NULL,
	[ingresoFecha] [date] NULL,
	[bajaFecha] [date] NULL,
 CONSTRAINT [PK_empleados] PRIMARY KEY CLUSTERED 
(
	[id] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
) ON [PRIMARY]
GO

-- restriccion de clave foranea
alter table [empleados]
 add constraint FK_empleados_planta_clave
  foreign key (planta_clave)
  references plantas(clave);

  -- restriccion de clave foranea
alter table [empleados]
 add constraint FK_empleados_puesto
  foreign key (puesto)
  references puesto(clave);

  -- restricción default
ALTER TABLE [empleados] ADD  CONSTRAINT [DF_empleados_activo]  DEFAULT (1) FOR [activo]
GO

